  main_email: String,
  bio: String,
  gitHub_url: String,
  linkedin_url: String,
  bio_intro: String,
  bio_tagline: String,
  bio_pic: String
}),

SettingsModel = mongoose.model('profile_settings', SettingsSchema, 'profile_settings');

app.get('/profileSettings', (req, res) =&gt; {
  SettingsModel.find((err, settings) =&gt; {
