</code></pre>

<p>if i put <code>res.json(err)</code> in the <code>if(err){}</code> then it returns the same as <code>res.json(settings)</code> and I get a 200 status but this doesn't let me properly handle errors.</p>

<p>Thanks in advance. Here are the versions I am using</p>

<p>node: 10.15.1</p>

<p>express: 4.16.1</p>

<p>mongoose: 5.9.14</p>

<p>mongoDB Atlas Service</p>

