Mongoose find and lookup<p>I am in a company wanting to list the User Stories of the team.
I have two tables.
One contains the US.
The other contains Sprints which themselves contain the US ids that were made during this sprint.</p>

<p>Shemas looks something like this.</p>

<pre><code>
const Userstories = mongoose.Schema({
    Name: String,  
    Date: Date
});

const Sprint= mongoose.Schema({
    Name: String,
    Userstories: [{type: mongoose.Schema.Types.ObjectId, ref: "userStory"}],
    Author: String,
    Date: Date
});

</code></pre>

<p>Sometimes I need the US list for a specific Sprint.</p>

<p>And for that I used the lookup function.
But I do not know why, I can't do a find at the same time.
In the end I did this:</p>

<pre><code>Sprint.aggregate([{
        $lookup: {
            from: 'userstories',
            localField: 'Userstories',
            foreignField: '_id',
            as: 'Userstories'
        }
    }
const photos = agregate.find(us =&gt; us._id == id);

</code></pre>

<p>I do the aggregation first and find it after.</p>

<p>But I guess doing it that way is costly in computation time.</p>

<p>That why I wanted to know if Mongoose optimizes this kind of case?
And if not, how can I write my request more properly?</p>

